// [2,7,11,15] target=9


const twoSums = (arr, target) => {
  let values = {}

  for (let i=0; i<arr.length; i++){
    let dif = target - arr[i];

    if(values[dif] === undefined){
      values = {
        ...values,
        dif: arr[i]
      }
    }
    else {
      console.log('here')
      return [i, values[dif]]
    }
  }

}

export default twoSums;
